import React from 'react';
import UploadVideo from './components/UploadVideo';
import WebcamCapture from './components/WebcamCapture';

function App() {
  return (
    <div style={{ textAlign: 'center', padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ marginBottom: '40px', color: '#2c3e50' }}>Bad Posture Detection App</h1>

      <div style={{
        marginBottom: '50px',
        padding: '20px',
        border: '1px solid #ccc',
        borderRadius: '10px',
        boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
        maxWidth: '600px',
        margin: 'auto'
      }}>
        <h2 style={{ marginBottom: '20px', color: '#34495e' }}>Upload Image / Video</h2>
        <UploadVideo />
      </div>

      <div style={{
        padding: '20px',
        border: '1px solid #ccc',
        borderRadius: '10px',
        boxShadow: '0 2px 8px rgba(0, 0, 0, 0.1)',
        maxWidth: '600px',
        margin: '50px auto'
      }}>
        <h2 style={{ marginBottom: '20px', color: '#34495e' }}>Live Capture via Webcam</h2>
        <WebcamCapture />
      </div>
    </div>
  );
}

export default App;
